import React from 'react'
import { useSelector,useDispatch } from 'react-redux'

const Example1 = () => {

  const myState = useSelector((state) => state.changeNo);
  
  return (
    <>
        <a>Plus</a>
        <input value={myState}/>
        <a>Minus</a>
    </>
  )
}

export default Example1
